import './App.css';
import Checkviz from './components/Checkviz';
import Explorer from './components/Explorer';

import { Checkbox } from '@material-ui/core';



function App() {
  return (
    <div id="App-wrapper">
      <div id="App-header">
        <div id="App-title">CheckCluster - Explaining the Cluster Reliability of Multidimensional Projections</div>
      </div>
      <div className="App-container">
        <div className="App-sidebar">
          Select dataset
          <Checkbox
            id={"dataset"}
            size="small"
            color="default"
            onChange={(event) => {
              // let n = { ...checkedDic };
              // n[id] = event.target.checked;
              // setCheckedDic(n);
            }}
          />
        </div>
        <div className="App-main">
          {/* <Checkviz
            method="tsne"
            dataset="mnist_sampled_50"
            isLabel={true}
            radius={5}
          /> */}
          <Explorer
            method="tsne"
            dataset="mnist_sampled_2"
            isLabel={true}
            showMissing={true}
            showFalse={true}
            radius={2}
            stroke={5}
          />
        </div>
      </div>
    </div>
  );
}

export default App;
